function computeMode(fp, m, n){
  let mode = [];
  for (let i = 0; i < n; i++) {
    const values = new Map();
    //stattdessen dict
    for (let j = 0; j < m; j++) {
      let check = false;
      for (const [key, value] of values) {
        if(fp[j][i] == key) {
          //stattdessen dict
          check = true;
          let num = value + 1;
          values.set(key, num);
          //stattdessen dict
          break;
        }
      }
      if (check == false){
        values.set(fp[j][i], 1);
        // dict values
      }
    }
    let mostValue = [];

    mostValue = [null, -1]

    for (const [key, value] of values) {
      if (value > mostValue[1]){
        mostValue = [key, value];
      }
    }
    // durch das ganze dict gehen
    // wert mit meisten nums in mostValue

    mode.push(mostValue[0]);
  }

  //console.log(mode);
  return mode;
}

function getNumCoincedences(fp1, fp2, m, n) {
  let numCoincedences = 0;
  let fp1Mode = [];
  fp1Mode = computeMode(fp1, m, n);
  for (let j = 0; j < n; j++) {
    let check = false;
    let k = 0;
    while ((k<m) && (check == false)){
      if (fp1Mode[j] == fp2[k][j]){
        numCoincedences++;
        check = true;
      }
      else {
        k++;
      }
    }
  }
  return numCoincedences;
}

function FPCheck(fp1, fp2, m, n, t){
  let num = getNumCoincedences(fp1, fp2, m, n);
  num = num + getNumCoincedences(fp2, fp1, m, n);
  let th = num / (n*2);
  console.log(num);
  console.log(th);
  if (th >= t) {
    return true;
  }
  else {
    return false;
  }
}





















